import React from 'react';

function Movie(props){
  console.log(props.fav);
  return <h1>I Like Movie!</h1>
}
function App() {
  return (
    <div>
      <h1>Hello!</h1>
      <Movie 
        fav="titanic"
      />
    </div>

  );
}

export default App;
